// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

// ERC1155
contract SampleERC1155 is ERC1155, Ownable {
    using Counters for Counters.Counter;
    string public name;
    string public symbol;
    mapping(uint256 => string) internal _tokenUri;
    mapping(uint256 => uint256) public totalSupply;

    constructor(string memory _name, string memory _symbol) ERC1155("") {
        name = _name;
        symbol = _symbol;
    }

    function mint(
        address account,
        uint256 id,
        uint256 amount,
        string memory tokenUri,
        bytes memory data
    ) external onlyOwner {
        if (
            keccak256(abi.encodePacked(tokenUri)) != keccak256(abi.encodePacked("")) &&
            keccak256(abi.encodePacked(tokenUri)) != keccak256(abi.encodePacked(_tokenUri[id]))
        ) {
            _tokenUri[id] = tokenUri;
        }
        totalSupply[id] = totalSupply[id] + amount;
        _mint(account, id, amount, data);
    }

    function mintByBatchId(
        address _to,
        uint256[] memory id,
        uint256[] memory amount,
        string[] memory tokenUri,
        bytes memory data
    ) external onlyOwner {
        require(amount.length == tokenUri.length, "Paramter not match");
        for (uint256 i = 0; i < id.length; i++) {
            if (
                keccak256(abi.encodePacked(tokenUri[i])) != keccak256(abi.encodePacked("")) &&
                keccak256(abi.encodePacked(tokenUri[i])) !=
                keccak256(abi.encodePacked(_tokenUri[id[i]]))
            ) {
                _tokenUri[id[i]] = tokenUri[i];
            }
        }

        _mintBatch(_to, id, amount, data);
    }

    function mintByAddressBatch(
        uint256 id,
        string memory tokenUri,
        address[] memory account,
        uint256[] memory amount,
        bytes[] memory data
    ) external onlyOwner {
        require(
            account.length == amount.length && amount.length == data.length,
            "Parameters not match"
        );

        if (
            keccak256(abi.encodePacked(tokenUri)) != keccak256(abi.encodePacked("")) &&
            keccak256(abi.encodePacked(tokenUri)) != keccak256(abi.encodePacked(_tokenUri[id]))
        ) {
            _tokenUri[id] = tokenUri;
        }

        uint256 totalMinted = 0;

        for (uint256 i = 0; i < account.length; i++) {
            _mint(account[i], id, amount[i], data[i]);
            totalMinted = totalMinted + amount[i];
        }

        totalSupply[id] = totalSupply[id] + totalMinted;
    }

    function burn(uint256 id, uint256 amount) external {
        totalSupply[id] = totalSupply[id] - amount;
        _burn(msg.sender, id, amount);
    }

    function burnBatch(uint256[] memory id, uint256[] memory amount) external {
        for (uint256 i = 0; i < id.length; i++) {
            totalSupply[id[i]] = totalSupply[id[i]] - amount[i];
        }
        _burnBatch(msg.sender, id, amount);
    }

    function setUri(uint256 id, string memory tokenUri) external onlyOwner {
        _tokenUri[id] = tokenUri;
    }

    function uri(uint256 id) public view override returns (string memory) {
        return _tokenUri[id];
    }
}

